svg.script:
function fix_width(node, width) {
node.setAttribute("lengthAdjust", "spacingAndGlyphs");
node.setAttribute("textLength", width);
}

function split_on_middle_space(text) {
const middle = Math.round(text.length / 2);
const first_tospace = text.lastIndexOf(" ", middle);
const last_tospace = text.indexOf(" ", middle);

let split_at;
if (!text.includes(" "))
split_at = text.length;
else if (Math.abs(first_tospace - middle) < Math.abs(last_tospace - middle))
split_at = first_tospace;
else
split_at = last_tospace;

return [text.substr(0, split_at), text.substring(split_at)];
}

const TITLE_WIDTH = 4750;
const title = document.querySelector(".Title > text");
if (title.getComputedTextLength() > TITLE_WIDTH)
fix_width(title, TITLE_WIDTH);

const PAREN_WIDTH = 3750;
const paren = document.querySelector(".Parentheses");
if (paren.getComputedTextLength() > PAREN_WIDTH)
fix_width(paren, PAREN_WIDTH);

const NONMETAL_WIDTH = 346 - 12;
const nonmetals = document.querySelector(".SeriesHeader + .SeriesHeader");
if (nonmetals.getComputedTextLength() > NONMETAL_WIDTH)
fix_width(nonmetals, NONMETAL_WIDTH);

const BOX_WIDTH = 247 - 12;
const names = document.querySelectorAll(".Name > text, .GroupText, .VerticalInner > text");
const long_names = [...names].filter(name => name.getComputedTextLength() > BOX_WIDTH);
long_names.forEach(name => fix_width(name, BOX_WIDTH));

const STATE_WIDTH = 360 - 12;
const states = document.querySelectorAll(".LegendText");
const long_states = [...states].filter(name => name.getComputedTextLength() > STATE_WIDTH);
long_states.forEach(name => fix_width(name, STATE_WIDTH));

const SERIES_HEIGHT = 448 - 12;
const series = document.querySelectorAll(".Series");
const long_series = [...series].filter(name => name.getComputedTextLength() > SERIES_HEIGHT);
long_series.forEach(name => {
const tspans = name.querySelectorAll("tspan");
const parts = split_on_middle_space(tspans[0].textContent);

tspans[0].textContent = parts[0];
tspans[1].textContent = parts[1];

if (tspans[0].getComputedTextLength() > SERIES_HEIGHT)
fix_width(tspans[0], SERIES_HEIGHT);
if (tspans[1].getComputedTextLength() > SERIES_HEIGHT)
fix_width(tspans[1], SERIES_HEIGHT);
});
